import { Box } from "@mui/material";
import BaseBox from "../components/BaseBox";
import DoubleBox from "../components/DoubleBox";

const HandRegist = () => {
  return (
    <BaseBox>
      <DoubleBox
        props1={{
          mx: "50px",
          my: "30px",
          p: "15px",
          width: "900px",
          borderRadius: "2%",
        }}
        props2={{ p: 2, height: "900px", borderRadius: "2%" }}
      >
        <Box
          my={4}
          display="flex"
          justifyContent="space-between"
          height="100px"
          border="1px solid black"
        >
          <Box mx={4} width="30px" border="1px solid black"></Box>
          <Box mx={4} width="30px" border="1px solid black"></Box>
          <Box mx={4} width="30px" border="1px solid black"></Box>
        </Box>
        <Box display="flex" height="30px" border="1px solid black"></Box>
        <Box display="flex" height="30px" border="1px solid black"></Box>
        <Box display="flex" height="30px" border="1px solid black"></Box>
        <Box display="flex" height="30px" border="1px solid black"></Box>
      </DoubleBox>
    </BaseBox>
  );
};

export default HandRegist;
